import { checkEmail, getSendCode } from "../../../services/signInUp-service";

const EmailPhase = ({phase, setPhase, email, setEmail, emailCode, setEmailCode}) =>{

    const onSubmit = async e =>{
        if(await checkEmail(email)){
            //setPhase(phase + 2);
        }else{
            setEmailCode(await getSendCode(email));
            //setPhase(phase + 1);
        }

        console.log(emailCode);
    }

    return(<form className="inner-signInUp" onSubmit={e => onSubmit}>
        <div className="annotation">
            <h1>
            Вход и регистрация
            </h1>
            <a>
            Нажимая «Далее», вы соглашаетесьс Правилами сайта
            </a>
        </div>
        <div className="emailField">
            <input type="text" placeholder={email} onChange={e => setEmail(e.target.value)}></input>
            <a>Специалисты не видят вашу почту. Вы сами решите, кому она будет доступена.</a>
        </div>
        <button className="buttonNext">
        Продолжить
        </button>
        <div className="additionalEnter">
            <a>
            Ещё можно войти через соцсети
            </a>
            <div className="buttonsAdditionalEnter">
                <button>

                </button>
                <button>

                </button>
                <button>

                </button>
                <button>

                </button>
            </div>
        </div>
    </form>);
}

export default EmailPhase;
